import * as React from 'react';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import Divider from '@mui/material/Divider';
import ListItemText from '@mui/material/ListItemText';
import ListItemAvatar from '@mui/material/ListItemAvatar';
import Avatar from '@mui/material/Avatar';
import Typography from '@mui/material/Typography';

export default function AlignItemsList() {
  return (
    <List sx={{
        // width: '100%',
    // bgcolor: 'background.paper' 
    }}>
        <ListItem sx={{display: 'block'}}>
        <Typography
                component="span"
                variant="body2"
                color="#757575"
              >
                페이스북의 사명 변경??
              </Typography>
        <Typography
                sx={{display: 'block' }}
                component="span"
                variant="body1"
                color="text.primary"
              >
                효림: 페이스북이 방향을 증강현실로 튼게 레버리지라는 관점을 최근에 봤는데 흥미로웠어...
              </Typography>
        </ListItem>
        <Divider component="li" />
      <ListItem alignItems="flex-start">
        <ListItemText
          primary="페이스북의 사명 변경??"
          secondary={
            <React.Fragment>
              <Typography
                sx={{display: 'inline' }}
                component="span"
                variant="body2"
                color="text.primary"
              >
                Ali Connors
              </Typography>
              {" — I'll be in your neighborhood doing errands this…"}
            </React.Fragment>
          }
        />
      </ListItem>
      <Divider component="li" />
      <ListItem alignItems="flex-start">
        <ListItemText
          primary="iMAC적응기(1) 아이맥을 사다!"
          secondary={
            <React.Fragment>
              <Typography
                sx={{ display: 'inline' }}
                component="span"
                variant="body2"
                color="text.primary"
              >
                to Scott, Alex, Jennifer
              </Typography>
              {" — Wish I could come, but I'm out of town this…"}
            </React.Fragment>
          }
        />
      </ListItem>
      <Divider component="li" />
      <ListItem alignItems="flex-start">
        <ListItemText
          primary="SNS 이민을 꿈꾸는 당신"
          secondary={
            <React.Fragment>
              <Typography
                sx={{ display: 'inline' }}
                component="span"
                variant="body2"
                color="text.primary"
              >
                Sandra Adams
              </Typography>
              {' — Do you have Paris recommendations? Have you ever…'}
            </React.Fragment>
          }
        />
      </ListItem>
    </List>
  );
}
